import 'dart:ui';

import 'package:flutter/material.dart';
import 'package:get/get.dart';

class ImageBlur extends StatefulWidget {
  const ImageBlur({super.key});

  @override
  State<ImageBlur> createState() => _ImageBlurState();
}

class _ImageBlurState extends State<ImageBlur> {
  double blur=0.11;
  @override
  Widget build(BuildContext context) {
    return Scaffold(
      body: Center(
        child: Column(mainAxisAlignment: MainAxisAlignment.center,
          children: [
           TweenAnimationBuilder(
            tween: Tween(begin: 0.01,end: blur),
            duration: Duration(seconds: 2), 
            builder: (BuildContext context,double ? value, Widget ? child){
              return SizedBox(
                  width: 300,
                  height: 300,
                  child: ImageFiltered(imageFilter: ImageFilter.blur(
                    sigmaX: value??00,
                    sigmaY: value??00
                  ),
                  child: Image(
                    fit: BoxFit.cover,
                    image: NetworkImage("data:image/jpeg;base64,"),),
                  ),

              );
            }),
            Slider(
              min: 0,
              max: 10,
              value: blur,
             onChanged: (
              Value
             ){
              setState(() {
                blur=Value;
              });
             })

          ],
        ),
      ),
    );
  }
}